`,"The sheer length of my 2,000 line ",g.jsx(c.code,{children:"index.js"})," forced me to scroll a lot when making changes. This made it harder to keep mental context on function inputs, outputs, and what I'm trying to accomplish. I mitigated this problem by using a split screen to view different sections of the same file, but this approach prevented me from split screening with another file (like the styles). I like to work on my laptop most of the time, so the limited screen real estate didn't help either."]}),`
